Here at KnowledgeWorks we like people that are pragmatic and have a “no drama” attitude! ;)

At the moment we are looking for someone knowledgeable at iOS Mobile Developer that would like to work somewhere in Lisbon, Portugal.

What you need to know? Really, really must know:

4 years+ experience with developing native iOS applications (SWIFT and Java);

Root cause analysis and diagnostic examinations to resolve issues;

Practical experience in design patterns;

Strong grounding in SOLID principles;

Experience with mapping and location based services;

Systems analysis and design;

Working in an agile team;

Source Control (GitHub, BitBucket);

Unit testing / test driven development;

Excellent knowledge with Java, SWIFT, SQL;

Good English communication skills.

